import React, { useState, useEffect } from "react";

const RecentCard = () => {
  const [cardData, setCardData] = useState([]);


  useEffect(() => {
    let token = localStorage.getItem("Authorization");
    fetch("http://127.0.0.1:8000/api/list/", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((res) => {
        return res.json();
      })
      .then((result) => {
        console.log(result);
        // setCardData(result.title);
      });
  }, []);




  return (
    <>
  <Card>
        <CardBody>
          <button className="btn btn-dark" data-toggle="modal" onClick={toggle}>
            Add Shop
          </button>

          <Table className="no-wrap mt-3 align-middle" responsive borderless>
            <thead>
              <tr>
                <th>Logo</th>
                <th>Name</th>
                <th>Description</th>
                <th>Services</th>
                <th>Address</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {tableData.map((tdata, index) => (
                <tr key={index} className="border-top">
                  <td>
                    <div className="d-flex align-items-center p-2">
                      <img
                        src={`http://127.0.0.1:8000${tdata.images}`}
                        className="rounded-circle"
                        alt="Logo"
                        width="45"
                        height="45"
                      />
                    </div>
                  </td>
                  <td>{tdata.name}</td>
                  <td>{tdata.description}</td>
                  <td>{tdata.services}</td>
                  <td>{tdata.address}</td>
                  <td>
                    <Badge
                      color="danger"
                      type="submit"
                      onClick={toggles}
                      // onClick={() => deleteApp(tdata.id)}
                      data-toggle="modals"
                    >
                      Delete
                    </Badge>
                  </td>

                </tr>
              ))}
            </tbody>
          </Table>
        </CardBody>
      </Card>
    </>
  );
};

export default RecentCard;






